import React from 'react';
import { Container, Typography, Box } from '@mui/material';

const About = () => (
  <Container maxWidth="md" sx={{ mt: 8 }}>
    <Box textAlign="center">
      <Typography variant="h3" fontWeight="bold" gutterBottom>
        About GoGetWell AI
      </Typography>
      <Typography variant="h6" color="text.secondary" mb={2}>
        Empowering Medical Tourism with AI & Automation
      </Typography>
      <Typography>
        GoGetWell AI is a SaaS platform built to revolutionize medical tourism businesses. We help organizations automate patient coordination, lead generation, and global support using cutting-edge AI agents and a seamless digital storefront. Our mission is to enable healthcare facilitators and providers to scale internationally and deliver exceptional patient experiences.
      </Typography>
    </Box>
  </Container>
);

export default About;
